import React, { Component } from "react";

import Post from "./components/post.js";
const postArray = [
  {
    content: "asdasfasfsdfsdf",
    time: "16:87",
    autor: "Baraky",
    initialLikes: 2
  },
  {
    content: "ooooooooooooo",
    time: "12:55",
    autor: "Lemos",
    initialLikes: 2
  }
];
class App extends Component {
  render() {
    return (
      <div>
        <h1>Minha rede social</h1>
        {postArray.map(post => {
          return;
          <Post time={post.time}>{post.content}</Post>;
        })}
        <Post time={"13:00"}>Texto Primeiro post</Post>
        <Post time={"14:00"}>Texto segundo post</Post>
        <Post time={"15:00"}>"Texto terceiro post"</Post>
        <Post time={"16:00"}>Texto quarto post</Post>
      </div>
    );
  }
}

export default App;
